import classes from './MainNavigation.module.css';
import {NavLink} from 'react-router-dom';

function MainNavigation() {
  return (
    <header className={classes.header}>
      <nav>
      <span className={classes.logo}>

            <NavLink to="/" className={({isActive})=>isActive?classes.active:undefined}end><h1>J'Adore</h1></NavLink>
      </span>
        <ul className={classes.list}>
           <li>
                <NavLink to="/" className={({isActive})=>isActive?classes.active:undefined}end>Sign In/Sign Up</NavLink>
           </li>
           <li>
               <NavLink to="/" className={({isActive})=>isActive?classes.active:undefined}end>Wishlist</NavLink>
           </li>
           <li>
               <NavLink to="/" className={({isActive})=>isActive?classes.active:undefined}end>Cart</NavLink>
            </li>
        </ul>
      </nav>
    </header>
  );
}

export default MainNavigation;
